import React from "react";

function TheFooter() {
  return (
    <div>
      <div>
        <div></div>
        <div>
          <p>hello@yay.com</p>
        </div>
        <div>Copyright 2020</div>
      </div>
    </div>
  );
}

export default TheFooter;
